import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#ffffff',
      flexDirection: 'row'
    },
    dayBox: {
      backgroundColor: '#ededed',
      flexDirection: 'column',
      marginRight: 50,
    }, 
    pages: {
      alignItems: 'center',
    }
  });
